・アンテナタイプ：導波管(4x16) <Br>
・受信バンド：Ku Band <Br>
・受信周波数：11.7GHz　～　12.75GHz <Br>
・受信偏波：右旋円偏波 <Br>
・受信利得：27 dBi <Br>         
・受信可能ビームエリア(EIRP)：57dbw<Br>
・アンテナ駆動方式：1軸ステッピングモーター  <Br>   
・方位角　サーチ速度(駆動速度) ：∞ <Br>
・仰角：60°/秒 <Br>
・動作温度：-15℃　～　+55℃<Br>
・設置温度：-15℃　～　+60℃  <Br>   
・定格：DC 12V <Br>
・消費電力：1.5A <Br>
・外形寸法：450mm(Φ)　×　148mm(H) <Br>
・本体重量：5.5kg <Br>
・電源供給器(電源線付属) DC12V用　(SW付) <Br>
付属品   <Br>       
・アンテナケーブル 5C-FB x10m <Br>
・チューナーケーブル 5C-FB x0.5m<Br>
